export default {
  path: '/Product',
  name: 'ProductIndex', // 这里必须与组件名一致
  meta: { title: '产品信息', requiresAuth: true },
  component: () => import('../views/product/Index.vue'),
  redirect: '/Product/ProductList',
  children:[
    {
      path: 'ProductList',
      name: 'ProductIndex', // 这里必须与组件名一致
      meta: { title: '产品信息', requiresAuth: true },
      component: () => import('../views/product/ProductList.vue'),
    },
    {
      path: 'Detail/:id',
      name: 'ProductDetail', // 命名规则 [模块名+文件名]
      meta:{
        title: '产品详情',
        requiresAuth: true
      },
      redirect:'Detail/:id/ProductInformation',
      component: () => import('../views/product/Detail.vue'),
      children:[
        {
          path: 'productInformation',
          name: 'ProductInformation', // 命名规则 [模块名+文件名]
          meta:{
            title: '基本信息',
            requiresAuth: true
          },
          component: () => import('../views/product/ProductInformation.vue'),
        },
        {
          path: 'productDatesReport',
          name: 'ProductDatesReport', // 命名规则 [模块名+文件名]
          meta:{
            title: '日期信息',
            requiresAuth: true
          },
          component: () => import('../views/product/ProductReport.vue'),
        },
        {
          path: 'securitiesInformation',
          name: 'SecuritiesInformation', // 命名规则 [模块名+文件名]
          meta:{
            title: '财务数据',
            requiresAuth: true
          },
          component: () => import('../views/product/SecuritiesInformation.vue'),
          children:[
          ]
        },
      ]

    }
  ]
};
